package com.parth.billingsoftware.service.impl;

import com.parth.billingsoftware.entity.UserEntity;
import com.parth.billingsoftware.io.UserRequest;
import com.parth.billingsoftware.io.UserResponce;
import com.parth.billingsoftware.repository.UserRepository;
import com.parth.billingsoftware.service.UserService;
import lombok.RequiredArgsConstructor;
import org.springframework.security.core.userdetails.UsernameNotFoundException;
import org.springframework.security.crypto.password.PasswordEncoder;
import org.springframework.stereotype.Service;

import java.util.List;
import java.util.UUID;
import java.util.stream.Collectors;

@Service
@RequiredArgsConstructor
public class UserServiceImpl implements UserService {
   private final UserRepository userRepository;
   private final PasswordEncoder passwordEncoder;
    @Override
    public UserResponce createUser(UserRequest request) {
        UserEntity newUser= convertToEntity(request);
        newUser=userRepository.save(newUser);
        return convertToResponce(newUser);
    }

    private UserResponce convertToResponce(UserEntity user) {
        return UserResponce.builder()
                .userId(user.getUserId())
                .email(user.getEmail())
                .role(user.getRole())
                .name(user.getName())
                .createdAt(user.getCreatedAt())
                .updatedAt(user.getUpdatedAt())
                .build();
    }


    private UserEntity convertToEntity(UserRequest request) {
        return UserEntity.builder()
                .userId(UUID.randomUUID().toString())
                .email(request.getEmail())
                .password(passwordEncoder.encode(request.getPassword()))
                .role(request.getRole())
                .name(request.getName())
                .build();
    }

    @Override
    public String getUserRole(String email) {
       UserEntity existingUser= userRepository.findUserByEmail(email)
                .orElseThrow(()->new UsernameNotFoundException("User not found with email: "+email));
        return existingUser.getRole();
    }

    @Override
    public List<UserResponce> readUsers() {
        return userRepository.findAll()
                .stream()
                .map(this::convertToResponce)
                .collect(Collectors.toList());
    }




    @Override
    public void deleteUser(String id) {
       UserEntity existingUser= userRepository.findUserByUserId(id)
               .orElseThrow(()->new UsernameNotFoundException("user not found"));
            userRepository.delete(existingUser);
    }
}
